        //  <Bar name="Casos" type="monotone"dataKey="casos" fill="#8884d8" />
        // <CartesianGrid strokeDasharray="8 8" />
        // <XAxis dataKey="nome" />
        // <YAxis />
        // <Tooltip />
        // <Legend />
        // </BarChart>
    );
  
}

export default ListaDiaria;
